import styled from "styled-components";

export const GetContact = styled.div`
    display: flex;
    width: 100%;
    align-items: center;
    justify-content: space-between;
`;

export const Touch = styled.div`
    /* background-color: tomato; */
    color: white;
    a{
        color: white;
        margin-right: 24px;
        font-size: 25px;
        transition: .2s ease-in-out;

        &:hover{
            transform: scale(1.1);
            color: var(--txt-hover);
        }
    }
`;
